import React, { useState } from 'react';
import { TextField}  from '@mui/material';

function Amplitude() {
  const [list, setList] = useState(["", "", "", "", ""]);
  const [ampList,setAmpList] = useState(["", "", "", "", ""]);
  const handleAmpChange = (index, event) => {
    let newList = [...ampList];
    newList[index] = event.target.value;
    setAmpList(newList);
  }

  const handleChange = (index, event) => {
    let newList = [...list];
    newList[index] = event.target.value;
    setList(newList);
  };

  return (
    <div>
        <h2>Amplitude</h2>
      {list.map((item, index) => (
        <TextField
          key={index}
          label={`Freq${index + 1}`}
          variant="outlined"
          value={item}
          onChange={(event) => handleChange(index, event)}
        />
      ))}
      <h3> Amp </h3> 
        {list.map((item, index) => (
        <TextField
          key={index}
          label={`${index + 1}`}
          variant="outlined"
          value={item}
          onChange={(event) => handleChange(index, event)}
        />
      ))}


    </div>
  );
}

export default Amplitude;
